export const renderRoutes = (route) => (
  <React.Suspense fallback={<div>Loading...</div>}>
    <Routes>
      <Route element={<ProtectedRoute user={user} />}>
        </Route>
      {
        routes.map((route, i) => {
          const RouteElement = route.element;
          const RouteLayout = route.layout || React.Fragment

          return (
            <Route key={i} path={route.path}
              element={

                  <RouteLayout>
                    <RouteElement />
                  </RouteLayout>

              }
            />
          )
        })
      }
    </Routes>
  </React.Suspense>
);


export const routes = [
  // define [home / 404]
  {
    path: '/home',
    layout: React.lazy(() => import('src/layouts/DashboardLayout')),
    element: React.lazy(() => import('src/views/home')),
  },
  {
    path: '/404',
    element: React.lazy(() => import('src/views/errors/NotFoundView')),
  },
  // customize  routes
  {
    path: '/login',
    element: React.lazy(() => import('src/views/SignIn')),
  },


  // define [redirect(=Navigate )]
  {
    path: "/",
    element: () => <Navigate replace to="/home" />
  },
  {
    path: "/*",
    element: () => <Navigate replace to="/404" />
  }
];
